function setWalletMax(uint8 maxPercentage) public {
    require(maxPercentage == uint8(maxPercentage), "Invalid percentage value");
    require(msg.sender == owner, "You are not the owner");

    // Ensure the calculation does not overflow
    require(
        totalSupply > 0 && maxPercentage <= 100,
        "Invalid max percentage or total supply"
    );

    // Calculate the wallet max based on the total supply and percentage
